const routes = require('next-routes')();

routes
    .add('/company_login','/company_login')
    .add('/voter_login','/voter_login')
    .add('/company_login/:address/company_dashboard','/election/company_dashboard');
module.exports = routes;
/*2nd one defines a new address for routing */
